import React from 'react';
import { Logo } from '../Logo/Logo';
import Style from '../LandingHeader/LandHeader.module.css';
import { Link } from 'react-router-dom';
import { Button } from '../Button/Button';
import { GetStarted } from '../GetStarted/GetStarted';

export const LandHeader = () => {
  return (
    <div id={Style.mainHeader}>
        <Link to='/' id={Style.logo}>
          <Logo id={Style.school} />
        </Link>

        <div id={Style.btnCon}>
          <GetStarted />

          <Link to='/signUp'>
              <Button text="Log in" className={Style.commonStyle} id={Style.signUp}></Button>
          </Link>
        </div>
    </div>
  )
}
